    <Grommet theme={hpe}>
        <UserContext.Provider value={contextValue}>
        <Box width={{ max: 'xxlarge' }} margin="auto" fill>
            <HeaderNavigationExample />
            <Box overflow="auto">
            <Box
                background="background"
                justify="center"
                pad={{
                horizontal: !['xsmall', 'small'].includes(size)
                    ? 'xlarge'
                    : 'medium',
                vertical: 'large',
                }}
                flex={false}
            >
                {user ? (
                <Box gap="large">
                    <Greeting />
                    <DashboardGrid />
                </Box>
                ) : (
                <DemoPageContent />
                )}
            </Box>
            {user && <HPEFooter />}
